import React,{useState} from "react";
import './carousel.css'
export default function Carousel() {
  const [currentIndex, setCurrentIndex] = useState(0);
  const images = [
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSiS8EOf9CFwW5b58OWHXoYQDX536ZJOc4oGw&usqp=CAU",
  ];
  const nextSlide = () => {
    setCurrentIndex((currentIndex + 1) % images.length);
  };

  const prevSlide = () => {
    setCurrentIndex((currentIndex - 1 + images.length) % images.length);
  };
  return (
    <div className="carousel-container">
      <button className="carousel-button prev-button" onClick={prevSlide}>
        &lt;
      </button>
      <img
        className="carousel-image"
        src={images[currentIndex]}
        alt={`Image ${currentIndex}`}
      />
      <button className="carousel-button next-button" onClick={nextSlide}>
        &gt;
      </button>
    </div>
  );
}
